import React from 'react';

import './card.css';

const Card = (props) => {
  return (
    <div className="card">
      <div className="img">
        <div className="like"></div>
      </div>
      <h3>Film name 1</h3>
      <h4>2023</h4>
    </div>
  );
};

export default Card;
